response.about:
Доброго дня! Я - Татьяна, психолог. Я влюблена в свою профессию, практикую уже более 8 лет. 

Работаю в направлении гештальт-терапии. Консультирую индивидуально и провожу терапевтические личностные группы.

У меня высшее психологическое образование, а также я постоянно забочусь о повышении квалификации (курсы, конференции, супервизия, личная терапия).

В настоящее время прохожу обучение в МИГИП (Московский институт гештальта и психодрамы), обучаюсь на гештальт-терапевта, 2 ступень.

Я помогаю разобраться в себе, преодолеть трудности на жизненном пути, обрести контакт с собой и другими.
А еще я жена, мама двоих деток, просто человек. Люблю читать, путешествовать семьей, капучино с шоколадкой и, порой, побыть одна.

Мне безумно интересно то, как уникально устроена наша психика и наша жизнь. У каждого своя неповторимая история и бесценный опыт!

Я буду вам полезна, если:
- вы хотите полюбить себя, обрести уверенность в себе, поднять самооценку;
- вы утратили ощущение самоценности, чувство самоуважения и желаете вновь обрести их;
- вы хотите разобраться в себе, понять причины своих поступков, свои мотивы и потребности, цели, ценности и желания;
- вы испытываете трудности в отношениях с другими (супругом, родителями, детьми, друзьями, родственниками, коллегами и др);
- вы переживаете разрыв отношений (развод, расставание);
- вы столкнулись с изменой, предательством близкого человека;
- у вас не складывается личная жизнь и вы страдаете от этого;
- вы на пути самореализации, но испытываете сложности, не чувствуете сил справиться самостоятельно;
- вас переполняют сильные переживания (злость, обида, ревность и пр);
- вы не можете сделать выбор, принять решение;
- вы переживаете внутриличностные конфликты (из серии «хочу, но боюсь», «умом понимаю, но поступаю иначе», «хочу, но не могу» или «хочу это и это - разрываюсь» и т.п.);
- вы хотите научиться жить своей жизнью, не оглядываясь на других, и быть счастливой не смотря ни на что.

Рада быть для вас полезной!
